import client from './client';

const joinURL = "http://localhost:8080/join";
const config = { headers : { "Content-Type": 'application/json' } };

export const login = ({ userId, password }) =>
    client.post('http://localhost:8080/login', { id: userId, pwd: password}).then(function (response) {
        console.log(response);
        return response;
    }).catch(function (error) {
        console.log(error);
        console.log(error.response.status);
    });

export const join = ({ userName, userId, password }) =>
client.post('http://localhost:3000/join', JSON.stringify({ 'name': userName, 'id': userId, 'pwd': password }), config).then(function (response) {
    console.log(response);
    return response;
}).catch(function (error) {
    console.log(error);
    return error;

});

export const check = () => client.get('/api/auth/check');
